import React from 'react';
import './App.css';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import Button from 'react-bootstrap/Button';
import {GrLinkedin} from 'react-icons/gr';
import {IconContext} from "react-icons"
import {GrGithub} from 'react-icons/gr';
import {GrMailOption} from 'react-icons/gr';


      // <div className="Photo">
      //   <img src="profile.png" style={{"height": "25%", "width": "25%"}} alt="Photo of me"/>
      // </div>

function App() {
  return (
    <div>
      <div className="App">
        <p> Nabeel Naiyer </p>
      </div>
      <div className="TopBar">
        <Navbar expand="lg" fixed="top" className="color-nav">
        <Navbar.Brand href="#email">
          <IconContext.Provider value={{ style: {fontSize: '28px'}}}>
            <a href = "mailto: naiyer.nabeel@gmail.com"></a>
              <div>
                <GrMailOption/>
              </div>
          </IconContext.Provider>
        </Navbar.Brand>
        <Navbar.Brand href="#git">
          <IconContext.Provider value={{ style: {fontSize: '30px'}}}>
          <a href="https://github.com/nnaiyer" target="_blank" style={{color:"black"}}>
            <div>
              <GrGithub/>
            </div>
          </a>
          </IconContext.Provider>
        </Navbar.Brand>
        <Navbar.Brand href="#linkedin">
          <IconContext.Provider value={{ style: {fontSize: '25px'}}}>
            <a href="https://www.linkedin.com/in/nabeelnaiyer/" target="_blank" style={{color:"black"}}>
              <div>
                <GrLinkedin/>
              </div>
            </a>
          </IconContext.Provider>
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="ml-auto">
              <Nav.Link href="#AboutMe">ABOUT ME</Nav.Link>
              <Nav.Link href="#Skills">SKILLS</Nav.Link>
              <Nav.Link href="#Projects">PROJECTS</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
      </div>
    </div>
  );
}

export default App;
